const zodiacNames = [
  "aquarius",
  "pisces",
  "aries",
  "taurus",
  "gemini",
  "cancer",
  "leo",
  "scorpio",
  "virgo",
  "libra",
  "sagittarius ",
  "capricorn",
];
const prices = [50];
const ZodiacImages = ["./img/zodiac-pics/images.jpg"];
const ZodiacText = [
  "Aquarius energy helps us innovate and unite for social justice",
];
const zodiacs = [
  {
    title: zodiacNames[0],
    category: zodiacNames[0],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[1],
    category: zodiacNames[1],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[2],
    category: zodiacNames[2],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[3],
    category: zodiacNames[3],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[4],
    category: zodiacNames[4],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[5],
    category: zodiacNames[5],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[6],
    category: zodiacNames[6],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[7],
    category: zodiacNames[7],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[8],
