    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[9],
    category: zodiacNames[9],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[10],
    category: zodiacNames[10],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
  {
    title: zodiacNames[11],
    category: zodiacNames[11],
    img: ZodiacImages[0],
    price: prices[0],
    text: ZodiacText[0],
  },
];
const mainSection = document.querySelector(".main-center-subpage");
const btnSection = document.querySelector(".sidebar-btns");
const btns = document.querySelectorAll(".btn-js");
const sidebar = document.querySelector(".sidebar-subpage");
const btnSidebar = document.querySelectorAll('.btn-sidebar')
// event listeners
window.addEventListener(
  "DOMContentLoaded",
  () => zodiacDisplay(zodiacs), sidebartoggle(), ListItemsSidebar()
);
// functions
function zodiacDisplay(par) {
  const items = par
    .map(
      (item) =>
        `<article class="article">
        <div class="header">
          <h4 class="sec-logo">${item.title}</h4>
          <div class="underline"></div>
        </div>
        <div class="img-container">
          <img src=${item.img} alt="" />
        </div>
        <div class="price">
          <div>
            <p>${item.price}Srd</p>
            <a href="aquarius.html"><i class="fas fa-info"></i></a>
          </div>
          <div class="underline"></div>
        </div>
        <p class="text">
          ${item.text}
        </p>
      </article>`
    )
    .join("");
  mainSection.innerHTML = items;
}
function sidebartoggle() {
  btns.forEach((btn) => {
    btn.addEventListener("click", (e) => {
      if (e.currentTarget.classList.contains("fa-bars")) {
        sidebar.classList.toggle("show-sidebar");
      }
      else if (e.currentTarget.classList.contains("fa-times")) {
        sidebar.classList.remove("show-sidebar");
      }
    });
  });
}
function ListItemsSidebar() {
  btnSidebar.forEach(btn => {
    btn.addEventListener('click', (e) => {
      if (e.target) {
        sidebar.classList.remove('show-sidebar')
      }
    })
  });
}
